import './App.css';
import './assets/css/index.css';
import  Client  from "./pages/Choix_page/Client";
import  HomeClient  from "./pages/Choix_page/HomeClient";
import HomePage from "./pages/Choix_page/HomePage";
import  Back_office  from "./pages/Choix_page/Back_office";
import { Routes, Route, Link} from "react-router-dom";


function App() {
  const linkColor = {
    color:'#748B6F'
  }
  return (
    <>
  <Routes>
    <Route path="/" element={<HomePage/>}/>
    <Route path="/Client" element={<HomeClient/>} />
    <Route path="/Back_office" />
  </Routes>
    </>
  )
}

export default App;
